import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { id: "e1", title: "toilet paper", amount: 94 },
    { id: "e2", title: "kitchen paper", amount: 23 },
    { id: "e3", title: "drawing paper", amount: 11 },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[1].title}
        amount={expenses[1].amount}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[2].title}
        amount={expenses[2].amount}
      ></ExpenseItem>
      {/* When it has no content you can put it as <ExpenseItem /> */}
    </div>
  );
}

export default App;
